    corpus: "Ishte e martë mbasdite. Donte edhe një orë që të mbaronte orari zyrtar. Agimi ngriti kokën nga dosja dhe fërkoi sytë. Kishte një javë që kishte filluar punën dhe ende nuk po mësohej dot me leximin e zgjatur. Fqinji i tij nga e djathta lëvizi nga në ndenjëse pa e ndërprerë leximin. Në tryezën e gjatë dëgjohej herë pas here fëshfërima e fletëve që ktheheshin. Askush nuk po e ngrinte kryet. Ishte muaji nëntor. Dosjet sa vente bëheshin më të trasha. Ishte periudha e zakonshme e vërshimit të ëndrrave. Kjo ishte një nga gjërat kryesore që kishte mësuar Albani gjatë javës së parë në punën e re. Ëndrra shikoheshin gjithmonë dhe ëndrra dërgoheshin gjithmonë, dhe kështu do të ishte në jetë të jetëve, por megjithatë kishte periudha që ato buisnin, ashtu siq kishte edhe tjera që pakësoheshin. Tani ishte një periudhë vërshimi. Ato mbërrinin me dhjetëra mijëra nga të gjitha skajet e shtetit të pafund. Dhe kështu do të vazhdonin gjer në fund të vitit. Dosjet do të fryheshin e do të frysheshin pa pushim, bashkë me shtrëngimin e të ftohtit. Pastaj, pas Vitit të Ri, do të kishte njëfarë mehje në pranverë.",
